import Backdrop from "./components/Backdrop/Backdrop"

function App() {
  const toolBarHeight = "50px"

  let toolBarItems = {
    logo: "KenzTV",
    navItemList: [
      { reference: "/", name: "Products" },
      { reference: "/", name: "Users" },
    ],
  }

  let sideBarItemList = [
    { reference: "/", name: "Products" },
    { reference: "/", name: "Users" },
  ]

  const App = styled.div`
    margin: 0 auto;
    color: white;
    height: 100%;
  `

  return (
    <App>
      <Toolbar toolBarItems={toolBarItems} toolBarHeight={toolBarHeight} />
      <SideDrawer sideBarItemList={sideBarItemList} />
      <ContentArea toolBarHeight={toolBarHeight} />
      {/* <h1>The user is {userList}</h1> */}
      {/* <WeatherCard temperature={-20} /> */}
    </App>
  )
}

export default App
